import React, { useState } from "react";
import "./LoginPage.css";
import { Link } from "react-router-dom"; 

const LoginPage = () => {
  const [username, setUsername] = useState(""); // State to store the username
  const [password, setPassword] = useState(""); // State to store the password

  return (
    <div className="loginpage">
      <div className="loginpage-child" />
      <div className="div45">운동뭉치</div>
      <div className="id" onClick={() => document.getElementById("usernameInput").focus()}>
        <input
          id="usernameInput"
          type="text"
          placeholder="아이디"
          className="input-box"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />
      </div>
      <div className="div47">아이디찾기</div>
      <div className="div48">비밀번호찾기</div>
      <div className="div49">간편 로그인</div>
      <div className="div50">
        <Link to="/signuppage">운동뭉치 회원가입</Link>
      </div>
      <div className="div51" onClick={() => document.getElementById("passwordInput").focus()}>
        <input
          id="passwordInput"
          type="password"
          placeholder="비밀번호"
          className="input-box"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
      </div>
      <div className="div52">로그인</div>
      <div className="loginpage-child2" />
      <div className="loginpage-child3" />
      <div className="loginpage-child4" />
      <div className="loginpage-child5" />
      <img className="kakao-login-1-icon" alt="" src="/kakao-login-1@2x.png" />
    </div>
  );
};

export default LoginPage;
